  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=364 DEFAULT CHARSET=utf8 COMMENT='El campo ''inventario_tipo_documento_id'' sirve para asociar con la tabla inventario_tipo_documento, y obtener el codigo segun las tablas de SUNAT.\r\nEl campo ''inventario_documento_id'' dependera del valor de ''inventario_tipo_origen'':\r\n- Si es carpeta de importacion  -> hace referencia a carpeta_importacion_documento. Este documento pertenece a carpeta_importacion_elemento con nombre "FB".\r\n- Si es venta -> hace referencia a la factura de la tabla factura. Seria igual al campo ''entidad_id''.\r\n- Si es nota de credito -> igual que en el caso de venta.\r\n- Si es ajuste -> hace referencia a la tabla de transacciones.';
