CREATE DEFINER=`holinsys`@`%` FUNCTION `fun_carpeta_importacion_numero_serie`(inventarioDocumentoId INT) RETURNS varchar(50) CHARSET utf8
BEGIN
DECLARE result VARCHAR(50);
SELECT carpeta_importacion_documento.codigo into @result 
FROM
carpeta_importacion_documento
INNER JOIN carpeta_importacion_elemento ON carpeta_importacion_documento.carpeta_importacion_elemento_id = carpeta_importacion_elemento.id
INNER JOIN carpeta_importacion ON carpeta_importacion_elemento.carpeta_importacion_id = carpeta_importacion.id
WHERE
carpeta_importacion.id = inventarioDocumentoId
	AND (carpeta_importacion_elemento.nombre LIKE 'Factura%'
	OR carpeta_importacion_elemento.nombre = 'ExWork') 
ORDER BY carpeta_importacion_documento.fecha_creacion ASC
LIMIT 1;
RETURN @result ;


END ;;
DELIMITER ;
