CREATE DEFINER=`holinsys`@`%` PROCEDURE `usp_actualiza_costos`(IN `vInvetarioId` INT, IN `vArticuloId` INT)
BEGIN

	DECLARE cInventarioId INT DEFAULT 0;
	DECLARE cCantidad INT DEFAULT 0;
	DECLARE cCostoUnit DOUBLE DEFAULT 0;
	DECLARE cCostoTotal DOUBLE DEFAULT 0;
	DECLARE cCantidadFinal INT DEFAULT 0;
	DECLARE cCostoUnitFinal DOUBLE DEFAULT 0;
	DECLARE cCostoTotalFinal DOUBLE DEFAULT 0;
	DECLARE cAntCantidad INT DEFAULT 0;
	DECLARE cAntCostoUnit DOUBLE DEFAULT 0;
	DECLARE cAntCostoTotal DOUBLE DEFAULT 0;
	DECLARE cAntCantidadFinal INT DEFAULT 0;
	DECLARE cAntCostoUnitFinal DOUBLE DEFAULT 0;	
	DECLARE cAntCostoTotalFinal DOUBLE DEFAULT 0;

	DECLARE cursor_registros CURSOR FOR
		SELECT id, cantidad, costo_unitario, costo_total,
			final_cantidad, final_costo_unitario, final_cantidad_total
		FROM inventario
		WHERE id >= vInvetarioId AND articulo_id = vArticuloId;
		
	-- Declaración de un manejador de  error tipo NOT FOUND
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET @hecho = TRUE;
	
	OPEN cursor_registros;
	loop1: LOOP
	
		FETCH cursor_registros INTO cInventarioId, cCantidad, cCostoUnit, cCostoTotal,
											cCantidadFinal, cCostoUnitFinal, cCostoTotalFinal;
		IF @hecho THEN
			LEAVE loop1;
		END IF;

		/* El primer registro ya fue actualizado desde InventarioController */		
		IF (cInventarioId > vInvetarioId) THEN
			/* Se calcula nuevamente la cantidad final, el costo unitario final
				y el costo total final */
			
			/* CANTIDAD FINAL*/
			SET cCantidadFinal = cAntCantidadFinal + cCantidad;
			
			/* COSTO TOTAL FINAL */
			SET cCostoTotalFinal = ROUND(cAntCostoTotalFinal + cCostoTotal, 2);
			
			/* COSTO PROMEDIO FINAL */
			IF (cCantidadFinal > 0) THEN
				IF (cCantidad > 0) THEN
					/* Ingreso */
					SET cCostoUnitFinal = cCostoTotalFinal / cCantidadFinal;
				ELSE
					SET cCostoUnitFinal = cAntCostoUnitFinal;
				END IF;
				SET cCostoUnitFinal = ROUND(cCostoUnitFinal,2);
			ELSE
				/* No hay stock */
				SET cCostoUnitFinal = 0;
			END IF;
			
			UPDATE inventario
			SET final_cantidad = cCantidadFinal,
				final_costo_total = cCostoTotalFinal,
				final_costo_unitario = cCostoUnitFinal
			WHERE id = cInventarioId;
			
		END IF;
		
		SET cAntCantidad = cCantidad;
		SET cAntCostoUnit = cCostoUnit;
		SET cAntCostoTotal = cCostoTotal;
		SET cAntCantidadFinal = cCantidadFinal;
		SET cAntCostoUnitFinal = cCostoUnitFinal;
		SET cAntCostoTotalFinal = cCostoTotalFinal;
		
	END LOOP loop1;
	CLOSE cursor_registros;

END ;;
DELIMITER ;
