                        FROM cotizacion
                        INNER JOIN cotizacion_detalle ON cotizacion.id =cotizacion_detalle.cotizacion_id
                        INNER JOIN articulo ON articulo.id =cotizacion_detalle.articulo_id
                        INNER JOIN cliente ON cliente.id =cotizacion.cliente_id
                        left JOIN tipo_cambio ON (tipo_cambio.moneda =cotizacion.moneda and tipo_cambio.fecha= DATE_FORMAT(cotizacion.fecha,'%Y-%m-01'))
                        INNER JOIN centro_costo ON cotizacion.numero =centro_costo.codigo
                        LEFT OUTER JOIN factura ON factura.centro_costo_id =centro_costo.id                       
                        where ((cotizacion.fechaAceptacionCliente < STR_TO_DATE( CONCAT('01/',vMes,'/',vAnio), '%d/%m/%Y %T')) and (cotizacion.estado_id=6 or cotizacion.estado_id=7)                        
